import styled from "styled-components";

let Container = ({ children }) => {
  const Container = styled.div`
    height: 100vh;
    display: flex;
    justify-content: center;
    align-items: center;
  `;

  const Center = styled.div`
    width: 100%;
  `;

  return (
    <Container>
      <Center>{children}</Center>
    </Container>
  );
};

export default Container;
